import './Stack.css';

class Stack extends Component {
	state = {
		stack: []
	}
	
	enqueue = () => {
		this.setState({ stack: []});
	}
	
	render() {
		return (
			<>
				<p>Stack goes here.</p>
				<button>Enqueue</button>
				<input type="text" />
				<button>Bruh</button>
			</>
		);
	}
}

export default Stack;
